import {configureStore,combineReducers} from "@reduxjs/toolkit"
import  { userDropdown } from "./user-dropdown/UserDropdown";



const reducer = combineReducers({
    click: userDropdown
})
const store = configureStore({
    reducer,
})


export default store;
